import React, {useState, useEffect} from 'react'
import Axios from 'axios';
import Grid from '@mui/material/Grid';
import { useParams, Link } from 'react-router-dom'

const EditVaultData = () => {
    const [vault, setVault] = useState([]);
    const { id, vaultid } = useParams();


    function traerVault(user) {
        Axios.get(`/users/api/edit/${id}/${vault}`)
            .then(res => {
                setVault(vault => res.data)
            })
            .catch(err => {
                console.log(err)
            })
    }
    useEffect(() => {
        traerVault();
    }, []);

    return (
        <>
            <Grid container >
                <h1 className='mt-5'>Hola</h1>
                <h1>Hola</h1>
                <h1>Hola</h1>
                <h1>Hola</h1>
            </Grid>

        </>
    )
}

export default EditVaultData
